import React,{useState} from "react";
import { useParams, Link, Outlet, useLocation } from "react-router-dom";

function Payment() {
  const location = useLocation();
  const cost = location.state.totalcost;
  const count = location.state.counts;
  const theater = location.state.theatre;
  const time = location.state.time;
  const date = location.state.date;
  const name = location.state.name;
  const title = location.state.title;
  const photo =location.state.photo;
  const [activeb, setactiveb] = useState(null);
 
  var num = cost / count;
   function handleselect(data) {
     setactiveb(data);
   }
   var num1;
  return (
    <div id="payment">
      <div className="payment">
        <div className="pay-photo">
          <img
            className="pay-image"
            src={`https://image.tmdb.org/t/p/w500/` + photo}
            height="120"
            width="120"
          />
        </div>
        <div className="pay-content">
          <p>
            <strong>{title}</strong>
          </p>
          <p>
            {date}- {time}
          </p>
        </div>
      </div>

      <div className="payment-cost">
        <div className="pay-cost"></div>
        <div className="pay-cost">
          <p>Cost of each ticket</p>
          <p>{num}.00</p>
        </div>
        <div className="pay-cost">
          <p>No. of tickets</p>
          <p>{count}</p>
        </div>

        <div className="pay-cost">
          <p>Sub Total</p>
          <p>{cost}.00</p>
        </div>
        <div className="pay-cost">
          <p>Commission Fee</p>
          <p>
            <span>Free</span>
          </p>
        </div>
        <hr />
        <div className="pay-cost">
          <p>Total Amount :</p>
          <p>
            <span>{cost}.00</span>
          </p>
        </div>
        <hr />
        <div className="pay-cost">
          <button
            className="paycost-button"
            name="button1"
            value="google-pay"
            id={activeb === "button1" ? "payid" : "pay"}
            onClick={() => {
              handleselect("button1");
              num1 = "Google-Pay";
            }}
          >
            <i class="fa-brands fa-google-pay fa-2x"></i>
          </button>
          <button
            className="paycost-button"
            name="button1"
            value="amazon-pay"
            id={activeb === "button2" ? "payid" : "pay"}
            onClick={() => {
              handleselect("button2");
              num1 = "Amazon-Pay";
            }}
          >
            <i class="fa-brands fa-amazon-pay fa-2x"></i>
          </button>
          <button
            className="paycost-button"
            name="button1"
            value="visa"
            id={activeb === "button3" ? "payid" : "pay"}
            onClick={() => {
              handleselect("button3");
              num1 = "Visa";
            }}
          >
            <i class="fa-brands fa-cc-visa fa-2x"></i>
          </button>
          <button
            className="paycost-button"
            name="button1"
            value="visa"
            id={activeb === "button3" ? "payid" : "pay"}
            onClick={() => {
              handleselect("button3");
              num1 = "Visa";
            }}
          >
            <i class="fa-brands fa-apple-pay"></i>
          </button>
        </div>
        {activeb && (
          <div className="payconfirm">
            <button className="payconfirm-button">Pay through {num1}</button>
          </div>
        )}
      </div>
    </div>
  );
}

export default Payment;
